// 使用 Mock
var Mock = require("mockjs");
var data = Mock.mock("/user/login", "post", {
  status: 200,
  msg: "success",
  data: {
    token: "dsfdsfdsfdfd",
    user: {
      username: "admin",
      roles: "admin",
      // avatar:''
    },
  },
});

var data = Mock.mock("/user/register", "post", {
  status: 200,
  msg: "success",
  data: {
    username: "",
  },
});
// 输出结果
// console.log(JSON.stringify(data, null, 4));

export default data;
